import { Accordion, AccordionItem, AccordionItemHeading, AccordionItemPanel, AccordianItemButton } from "react-accessible-accordion";

const Forecast = ({ data }) => {
    return (
        <>
            <label className="title">Daily
            </label>
            <Accordion allowZeroExpanded>
                {data.list.splice(0, 7).map((item, idx =>
                    <AccordionItem key={idx}>
                        <AccordionItemHeading>
                            <AccordianItemButton>
                                HELLLO
                            </AccordianItemButton>
                        </AccordionItemHeading>
                        <AccordionItemPanel></AccordionItemPanel>
                    </AccordionItem>

                ))}

            </Accordion>
        </>
    );
}

export default Forecast;
